import React from 'react'

class Form extends React.Component {
state={
    fullname:[]
}

handleSubmit = (event) => {
    event.preventDefault
}

render() {
    return (
        <div>

      <form onSubmit={this.handleSubmit}>     
      <input name="fullname"/>
      </form>  
      <button>submit</button>

        </div>
    )
}
}

export default Form
